import { useState } from "react";
import FabricBoard from "../FabricBoard/FabricBoard";
import KonvaBoard from "../KonvaBoard/KonvaBoard";
import PaperJSBoard from "../PaperJSBoard/PaperJSBoard";
import styles from "./Main.module.css";

const BOARD_TYPE = {
  FABRIC: "FABRIC",
  KONVA: "KONVA",
  PAPERJS: "PAPERJS",
};

export default function Main() {
  const [boardType, setBoardType] = useState(BOARD_TYPE.FABRIC);
  return (
    <div className={styles.wrapper}>
      <div>
        <button onClick={() => setBoardType(BOARD_TYPE.FABRIC)}>Fabric</button>
        <button onClick={() => setBoardType(BOARD_TYPE.KONVA)}>Konva</button>
        <button onClick={() => setBoardType(BOARD_TYPE.PAPERJS)}>
          PaperJS
        </button>
      </div>
      {boardType === BOARD_TYPE.FABRIC && <FabricBoard />}
      {boardType === BOARD_TYPE.KONVA && <KonvaBoard />}
      {boardType === BOARD_TYPE.PAPERJS && <PaperJSBoard />}
    </div>
  );
}
